import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Redirect, Route, Switch } from 'react-router-dom';
import Resume from './components/Resume';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/resume" component={Resume} />
        <Redirect from="/" to="resume" />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
